const homeImageStyle = {
    height: '100%',
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    backgroundSize: 'cover'
}

const Home = () => (
    <img src="/homepage-image.jpg" alt="homepage image" style={homeImageStyle}/> 
)

export default Home;
